import React, { useEffect, useState } from 'react';
import { request } from '../../helpers/axios_helper';

const ViewEditors = () => {
  const [editors, setEditors] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchEditors = async () => {
      try {
        const response = await request('GET', '/admin/viewEditors'); // Adjust the endpoint if necessary
        setEditors(response.data);
      } catch (err) {
        setError('Failed to fetch editors');
      } finally {
        setLoading(false);
      }
    };

    fetchEditors();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div>
      <h2>Editors List</h2>
      {editors.length === 0 ? (
        <p>No editors found.</p>
      ) : (
        <ul>
          {editors.map((editor) => (
            <li key={editor.id}>{editor.firstName} {editor.lastName}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default ViewEditors;
